//This is the main app of our application, all of the final renderings go here
import './App.css';
import LoginPage from './pages/LoginPage';
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <div className="App">
      <p>This is our react app!</p>
      <AuthProvider>
        <LoginPage />
      </AuthProvider>

    </div>
  );
}

export default App;
